class Index extends React.Component {
    state = { open: false };
    render() {
        return (
            <Page>
                <Layout>
                    <EmptyState
                        heading="Select products to start"
                        action={{
                            content: 'Select products',
                            onAction: () => console.log('clicked'),
                        }}
                        image={img}
                    >
                        <p>Select products and change their price temporarily</p>
                    </EmptyState>
                </Layout>
            </Page>
        );
    }
}
